import React from 'react'
import { Card } from 'react-bootstrap'
const Tours = () => {
    const arr=[
        {Id:1,Date:'JUL 16',Location:'DETROIT, MI'
        ,Theatre:'DTE ENERGY MUSIC THEATRE'},
        {Id:2,Date:'JUL19',Location:'TORONTO,ON'
        ,Theatre:'BUDWEISER STAGE'},
        {Id:3,Date:'JUL 22',Location:'BRISTOW, VA'
        ,Theatre:'JIGGY LUBE LIVE'},
        {Id:4,Date:'JUL 29',Location:'PHOENIX, AZ'
        ,Theatre:'AK-CHIN PAVILION'},
        {Id:5,Date:'AUG 2',Location:'LAS VEGAS, NV'
        ,Theatre:'T-MOBILE ARENA'},
        {Id:6,Date:'AUG 7',Location:'CONCORD, CA'
        ,Theatre:'CONCORD PAVILION'}

    ]
  return (
    <>
      {arr.map((item)=>{
        return <Card.Body>{item.Date}</Card.Body>
      })}
    </>
  )
}

export default Tours
